        'und' => array(
          array(
            'value' => "<p>You can connect your MMODA account to GitHub by editing your account:</p>\r\n\r\n<p>Click on the button \"My Account\":</p>\r\n\r\n<p><a class=\"colorbox colorbox-insert-image\" data-colorbox-gallery=\"gallery-all\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda/mmoda-my-account.png\"><img alt=\"\" class=\"same-gallery image-large\" height=\"100\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda/mmoda-my-account.png?itok=2mK1N6rd\" width=\"480\" /> </a></p>\r\n\r\n<p>A new tab/window opens showing a tab \"Connected Accounts\":</p>\r\n\r\n<p><a class=\"colorbox colorbox-insert-image\" data-colorbox-gallery=\"gallery-all\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda/mmoda-github-connect.png\"><img alt=\"\" class=\"same-gallery image-large\" height=\"383\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda/mmoda-github-connect.png?itok=c4yuhwkP\" width=\"480\" /> </a></p>\r\n\r\n<p>There you can connect your account by clicking on the button \"Connect with GitHub\"</p>\r\n\r\n<p>&nbsp;</p>\r\n",
